import React from 'react';
import { Box, Stack, Heading, Button } from '@chakra-ui/core';

const Form = ({bgColor, submit, tittle, children}) => {
    return (
        <Box
            backgroundColor={bgColor}
            onSubmit={submit}
            as="form"
            w="350px"
            boxShadow="x1"
        >
            <Stack spacing={8} p={8}>
                <Heading>
                    {tittle}
                </Heading>
                {children}
                <Button backgroundColor="yellow" type="submit" color="black">
                    {tittle}
                </Button>
            </Stack>
        </Box>
    );
};

export default Form;
